import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';
import { SharedModule } from 'app/shared/shared.module';
import { FileUploadModule } from 'primeng/fileupload';
import {
  TemplateService,
  TemplatePopupService,
  TemplateComponent,
  TemplateDetailComponent,
  TemplateDialogComponent,
  TemplatePopupComponent,
  TemplateDeleteDialogComponent,
  templateRoute,
  templatePopupRoute,
} from './';

const ENTITY_STATES = [...templateRoute, ...templatePopupRoute];

@NgModule({
  imports: [SharedModule, FileUploadModule, RouterModule.forChild(ENTITY_STATES)],
  declarations: [
    TemplateComponent,
    TemplateDetailComponent,
    TemplateDialogComponent,
    TemplateDeleteDialogComponent,
    TemplatePopupComponent,
  ],
  entryComponents: [TemplateComponent, TemplateDialogComponent, TemplatePopupComponent, TemplateDeleteDialogComponent],
  providers: [TemplateService, TemplatePopupService],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class TemplateModule {}
